import React, { useState, useEffect } from "react";
import timer from "../components/Timer";

const Timer = ({ duration }) => {
  const [time, setTime] = useState(duration);

  useEffect(() => {
    setTimeout(() => {
      setTime(time - 1000);
    }, 1000);
  }, [time]);

  return <div>timer</div>
};
